import React, { useState } from 'react';
import VolunteerForm from './VolunteerForm';
import VolunteerList from './VolunteerList';

const VolunteerPoints = () => {
    const [volunteers, setVolunteers] = useState([]);

    const addVolunteer = (name) => {
        setVolunteers([...volunteers, { name }]);
    };

    return (
        <div className="volunteer-management">
            <h2>Volunteer Points Management</h2>
            <VolunteerForm addVolunteer={addVolunteer} />
            <VolunteerList volunteers={volunteers} />
        </div>
    );
};

export default VolunteerPoints;
